import './search-box.style.css';

const SearchBox = ({ searchBoxProp }) => {
  return (
    <input
      className={`search-box ${searchBoxProp.className}`}
      type="search"
      placeholder={searchBoxProp.placeholder}
      onChange={searchBoxProp.onChangeHandler}
    />
  );
};

export default SearchBox;
